PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE users (
    user_id INTEGER PRIMARY KEY AUTOINCREMENT,
    firstName TEXT NOT NULL,
    lastName TEXT NOT NULL,
    email TEXT NOT NULL UNIQUE,
    phoneNumber TEXT NOT NULL,
    companyName TEXT NOT NULL,
    userRole TEXT NOT NULL CHECK (userRole IN ('exporter', 'compliance', 'admin')),
    companyType TEXT CHECK (companyType IN ('sme', 'logistics', 'freight', 'customs')),
    regNumber TEXT,
    primaryCountry TEXT NOT NULL,
    shippingVolume TEXT CHECK (shippingVolume IN ('low', 'medium', 'high')),
    password TEXT NOT NULL,
    twoFA BOOLEAN DEFAULT 0,
    notifs TEXT,
    alerts BOOLEAN DEFAULT 0,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);
CREATE TABLE united_states (
    HS_code INTEGER,
    main_category VARCHAR(255),
    sub_category VARCHAR(255)
);
CREATE TABLE united_kingdom (
    HS_code INTEGER,
    main_category VARCHAR(255),
    sub_category VARCHAR(255)
);
CREATE TABLE european_union (
    HS_code INTEGER,
    main_category VARCHAR(255),
    sub_category VARCHAR(255)
);
CREATE TABLE india (
    HS_code INTEGER,
    main_category VARCHAR(255),
    sub_category VARCHAR(255)
);
CREATE TABLE Consignments (
    uuid INTEGER PRIMARY KEY AUTOINCREMENT,
    sender_name TEXT NOT NULL,
    sender_address TEXT NOT NULL,
    sender_country TEXT NOT NULL,
    sender_mail TEXT NOT NULL,
    sender_phone TEXT NOT NULL,
    receiver_name TEXT NOT NULL,
    receiver_address TEXT NOT NULL,
    receiver_country TEXT NOT NULL,
    shipment_id TEXT NOT NULL,
    shipment_date TEXT NOT NULL,
    PackageQuantity INTEGER NOT NULL,
    HS_code TEXT NOT NULL,
    totalWeight REAL NOT NULL,
    Item_desc TEXT NOT NULL,
    handling_inst TEXT,
    commercial_invoice BLOB,  -- For storing PDF as binary data
    compliant TEXT CHECK(compliant IN ('pending', 'compliant', 'flagged')) DEFAULT 'pending',
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);
DELETE FROM sqlite_sequence;
COMMIT;
